import React from 'react';
import {Table} from 'react-bootstrap';


class PaySlipDetails extends React.Component {

  constructor(props) {
    super(props);
    this.state = {};
  }

  render() {
    return (
      <div className = "payslipwrapper">
      <h3>Payslip </h3>
      <h4>Employee Name </h4>
      <Table striped bordered hover>
      <thead>
        <th>
            <tr>First Name</tr>
            <tr>Last Name</tr>
            <tr>Username</tr>
          </th>
    </thead>
  <tbody>
    <tr>
      <td>1</td>
      <td>Mark</td>
      <td>Otto</td>
      <td>@mdo</td>
    </tr>
    <tr>
      <td>2</td>
      <td>Jacob</td>
      <td>Thornton</td>
      <td>@fat</td>
    </tr>
    <tr>
      <td>3</td>
      <td colSpan="2">Larry the Bird</td>
      <td>@twitter</td>
    </tr>
  </tbody>
</Table>

</div>


    );
  }
}

export default PaySlipDetails;
